import React from "react";
import ReactRoundedImage from "react-rounded-image";
import MyPhoto from "./ProfilePic.jpeg";

function ProfilePicture() {
	return (
		<ReactRoundedImage
			image={MyPhoto}
			roundedSize='0'
			imageWidth='150'
			imageHeight='150'
		/>
	);
}

function NameDescription() {
	return (
		<div>
            <h1>Borja Ingle-Fernandez</h1>
            <strong> </strong>
		</div>
	);
}

function HomePage() {
	return (
		<div
			style={{
				display: "flex",
				justifyContent: "center",
			}}
		>
			<ProfilePicture />
			<NameDescription />
		</div>
	);
}

export default HomePage;
